import { styled } from "styled-components";

const SellDiv = styled.div`
  position: relative;
`;

const A = styled.a`
  display: flex;
  align-items: center;
  margin-left: 30px;
`;

const Img = styled.img`
  width: 23px;
  height: 24px;
  margin-right: 5px;
`;

const SBTalk = () => {
  return (
    <div className="SBTalkDiv">
      <a>
        <img src="https://m.bunjang.co.kr/pc-static/resource/32554a59cf002b3def10.png"></img>
        번개톡
      </a>
    </div>
  );
};

export default SBTalk;
